Implementing a Comprehensive Risk Management Framework (including National
Vulnerability Risk Resilience Fund) and pursuing the Low Carbon Development
Pathway (the greening of the economy);

set up a low-carbon research and development centre
and, demonstration platform to promote development and
application of low-carbon technologies;
• strengthen the fundamental research on new energy;
• promote research and development of new energy and
renewable energy technologies;
• develop the core technologies with self-owned
intellectual patents;
• develop cutting edge technologies on low-carbon
economy;
• achieve technological breakthroughs in energy saving,
renewable energy, nuclear energy, carbon capture and storage
and developing clean automobiles;
• build proper systems to develop and maintain talents
on low-carbon technologies;
• strengthen protection of IPRs
